import React from "react";
import img81663225 from "../../assets/81663225.jpg";
import './bio.css'



const Bio = () => {
  return (
    <div class="bio">

      <img src={img81663225} alt="Profile Goers, Jack"></img>
      
        <h3>Hello!</h3>
        <p>My name is Jack and I'm a Full Stack developer. 
      </p>
    </div>

  );
};

export default Bio;
